(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[9299],{39299:function(e){"use strict";e.exports=JSON.parse('{"md":"\\n# Rule\\n\\nA `Rule` links a trigger and action group distributions together.\\n\\n| Field | Description | Type | Reference | Nullable | Deprecated |\\n|-------|-------------|------|-----------|----------|------------|\\n| id | The ID of the `Rule` | ID | [ID](/api-docs/id) | No | No |\\n| name | The name of the `Rule` | String | [String](/api-docs/string) | No | No |\\n| trigger | A `Trigger` attached to the `Rule`. | Trigger | [Trigger](/api-docs/trigger) | No | No |\\n| action_groups_distributions | All set of `ActionGroupDistribution`&#039;s attached to this `Rule` and will be triggered once `Event` and `ConditionRule`&#039;s are considered | List[ActionGroupDistribution] | [ActionGroupDistribution](/api-docs/action-group-distribution) | No | No |\\n| is_active | If the `Rule` is currently active or inactive | Boolean | [Boolean](/api-docs/boolean) | No | No |\\n| min_repeat_interval | The minimum refresh interval. -1 = the rule can&#039;t repeat. 0 = the rule can repeat. &gt; 0 the rule must wait this many milliseconds before being allowed to repeat again. | Int | [Int](/api-docs/int) | No | No |\\n\\n## Queries\\n\\n*Queries provide a function on the graph to access Rule entities. This should be considered the same as RESTful \'GET\'*\\n\\n---\\n\\n### Get Rule\\n\\n```graphql\\ngetRule(id: ID!): Rule\\n\\n```\\n\\nGet a `Rule` model from the `Rule` ID\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| id | -- | ID | [ID](/api-docs/id) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Rule | [Rule](/api-docs/rule) |\\n\\n\\n\\n\\n## Mutations\\n\\n*Mutations enable us to create, modify and delete Rule entities. POST/PUT/DELETE methods in a RESTful API would typically provide this functionality*\\n\\n---\\n\\n### Create Rule\\n\\n```graphql\\ncreateRule(ruleCreateInput: RuleCreateInput!): Rule\\n\\n```\\n\\nCreate a new `Rule`. `RuleGroup` ID is required here to ensure `Rule` is placed inside the correct version\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| ruleCreateInput | -- | RuleCreateInput | *RuleCreateInput* | Yes |  | No |\\n\\n\\n**RuleCreateInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| rule_group_id | The `RuleGroup` under which the `Rule` should be created | ID | [ID](/api-docs/id) | Yes |  | No |\\n| global_trigger_id | If provided, this rule will be bound to the `Trigger` id from `Revision` globals. It can&#039;t be changed to a custom trigger once set. | ID | [ID](/api-docs/id) | No |  | No |\\n| name | The name of the new `Rule` | String | [String](/api-docs/string) | Yes |  | No |\\n| min_repeat_interval | The minimum refresh interval. -1 = the rule can&#039;t repeat. 0 = the rule can repeat. &gt; 0 the rule must wait this many milliseconds before being allowed to repeat again. | Int | [Int](/api-docs/int) | No | -1 | No |\\n| comments | Any additional user comments for the audit | String | [String](/api-docs/string) | No |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Rule | [Rule](/api-docs/rule) |\\n\\n\\n\\n\\n---\\n\\n### Duplicate Rule\\n\\n```graphql\\nduplicateRule(ruleDuplicateInput: RuleDuplicateInput!): Rule\\n\\n```\\n\\nDuplicate a new `Rule`. The duplicated will copy everything beneath `Rule`, creating a new `Rule` entity and linking it to the same `RuleGroup`\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| ruleDuplicateInput | -- | RuleDuplicateInput | *RuleDuplicateInput* | Yes |  | No |\\n\\n\\n**RuleDuplicateInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| rule_id | `Rule` ID to clone against | ID | [ID](/api-docs/id) | Yes |  | No |\\n| name | New name for the `Rule` | String | [String](/api-docs/string) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Rule | [Rule](/api-docs/rule) |\\n\\n\\n\\n\\n---\\n\\n### Update Rule\\n\\n```graphql\\nupdateRule(ruleUpdateInput: RuleUpdateInput!): Boolean\\n\\n```\\n\\nUpdate a `Rule`&#039;s details.\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| ruleUpdateInput | -- | RuleUpdateInput | *RuleUpdateInput* | Yes |  | No |\\n\\n\\n**RuleUpdateInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| rule_id | `Rule` ID to update against | ID | [ID](/api-docs/id) | Yes |  | No |\\n| name | `Rule` name | String | [String](/api-docs/string) | No |  | No |\\n| is_active | If the `Rule` should be active or not | Boolean | [Boolean](/api-docs/boolean) | No |  | No |\\n| min_repeat_interval | The minimum refresh interval. -1 = the rule can&#039;t repeat. 0 = the rule can repeat. &gt; 0 the rule must wait this many milliseconds before being allowed to repeat again. | Int | [Int](/api-docs/int) | No |  | No |\\n| comments | Any additional user comments for the audit | String | [String](/api-docs/string) | No |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Boolean | [Boolean](/api-docs/boolean) |\\n\\n\\n\\n\\n---\\n\\n### Delete Rule\\n\\n```graphql\\ndeleteRule(ruleDeleteInput: RuleDeleteInput!): [ModelDeleteAcknowledgement]\\n\\n```\\n\\nDelete a `Rule` and its children.\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| ruleDeleteInput | -- | RuleDeleteInput | *RuleDeleteInput* | Yes |  | No |\\n\\n\\n**RuleDeleteInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| rule_id | `Rule` ID to delete against | ID | [ID](/api-docs/id) | Yes |  | No |\\n| preview | If true, we can do a dry-run and check what the outcome of this delete will be before commiting to it | Boolean | [Boolean](/api-docs/boolean) | No | false | No |\\n| comments | Any additional user comments for the audit | String | [String](/api-docs/string) | No |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| List[ModelDeleteAcknowledgement] | [ModelDeleteAcknowledgement](/api-docs/model-delete-acknowledgement) |\\n\\n\\n\\n\\n---\\n\\n### Update Action Distributions Order\\n\\n```graphql\\nupdateActionDistributionsOrder(ruleOrderInput: RuleOrderInput!): Boolean\\n\\n```\\n\\nUpdate the order of `ActionDistribution`&#039;s curently linked to `Rule`\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| ruleOrderInput | -- | RuleOrderInput | *RuleOrderInput* | Yes |  | No |\\n\\n\\n**RuleOrderInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| rule_id | `Rule` ID to order rules against | ID | [ID](/api-docs/id) | Yes |  | No |\\n| new_order | A new order of `Rule` IDs | List[ID] | [ID](/api-docs/id) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Boolean | [Boolean](/api-docs/boolean) |\\n\\n\\n\\n\\n---\\n\\n### Link Global Action Group Distribution\\n\\n```graphql\\nlinkGlobalActionGroupDistribution(globalActionGroupDistributionLinkInput: GlobalActionGroupDistributionLinkInput!): Boolean\\n\\n```\\n\\nLink a global `ActionGroupDistribution`&#039;s to a `Rule`\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| globalActionGroupDistributionLinkInput | -- | GlobalActionGroupDistributionLinkInput | *GlobalActionGroupDistributionLinkInput* | Yes |  | No |\\n\\n\\n**GlobalActionGroupDistributionLinkInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| rule_id | `Rule` ID | ID | [ID](/api-docs/id) | Yes |  | No |\\n| global_action_group_distribution_id | Global `ActionGroupDistribution` ID | ID | [ID](/api-docs/id) | Yes |  | No |\\n| comments | Any additional user comments for the audit | String | [String](/api-docs/string) | No |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Boolean | [Boolean](/api-docs/boolean) |\\n\\n\\n\\n\\n---\\n\\n### Unlink Global Action Group Distribution\\n\\n```graphql\\nunlinkGlobalActionGroupDistribution(globalActionGroupDistributionUnlinkInput: GlobalActionGroupDistributionUnlinkInput!): Boolean\\n\\n```\\n\\nLink a global `ActionGroupDistribution`&#039;s to a `Rule`\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| globalActionGroupDistributionUnlinkInput | -- | GlobalActionGroupDistributionUnlinkInput | *GlobalActionGroupDistributionUnlinkInput* | Yes |  | No |\\n\\n\\n**GlobalActionGroupDistributionUnlinkInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| rule_id | `Rule` ID | ID | [ID](/api-docs/id) | Yes |  | No |\\n| global_action_group_distribution_id | Global `ActionGroupDistribution` ID | ID | [ID](/api-docs/id) | Yes |  | No |\\n| comments | Any additional user comments for the audit | String | [String](/api-docs/string) | No |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Boolean | [Boolean](/api-docs/boolean) |\\n\\n\\n\\n"}')}}]);